import React, { useEffect, useState } from "react";


function Homepage(){

const [error, setError]=useState(null);

const [stocks,setStocks]=useState([]);


useEffect(()=>{

    fetch("http://localhost:8000/all-stocks")
    .then(res=>res.json())
    .then(
        (result)=>{

            setStocks(result);
        },
        (error)=>{
            setError(error);


        }
    )
},[])
    return (

        <>
Welcome to Homepage
        </>
    );
}

export default Homepage;
